import { Link, Outlet } from 'react-router-dom';

export const Layout = () => {
  return (
    <div>
      <header>
        {' '}
        <nav>
          <Link to="/login">Log in</Link>
          <hr />
        </nav>
      </header>
      <Outlet />
    </div>
  );
};
